import React, { useState } from 'react';

function Header() {
    const [fruits, setFruits] = useState(["Apple","Mango","Banana","Orange"
    ]);

    const handerColor = () => {
        setFruits("Green")
    }
    return (
        <div>
            <ul>
                {
                    fruits.map((data) => {
                        <li>{data}</li>
                    })
                }
            </ul>
            <button type="button" onClick={() => setFruits(["Graps","Papaya","Carrot","Banana"])}>click me!</button>
        </div>
    )
}

export default Header;
